  concept: daec72c2-190a-5d3d-978e-44a43d75e748
  definition: élément de contact destiné à établir la liaison électrique sur ses faces
    intérieures en s'accouplant avec les faces extérieures d'un autre élément de contact
  examples: []
  notes:
  - L’emploi en anglais du terme "socket contact" n’implique pas qu’un contact femelle
    est toujours monté dans un socle, ni que les socles ne comportent que des contacts
    femelles.
